    return (
        <div class="containeradmin">
            <div class="card">
                <img class="card-img-top" src={Platos} alt="Card image cap"></img>
                <div class="card-body">
                    <h5 class="card-title">Platos</h5>
                    <p class="card-text">Administrar menú</p>
                </div>
                <ul class="list-group list-group-flush">
                    <li class="list-group-item"><a href="#" class="card-link">Crear platos</a></li>
                    <li class="list-group-item"><a href="#" class="card-link">Editar platos</a></li>
                </ul>
            </div>


            <div class="card">
                <img class="card-img-top" src={Mesas} alt="Card image cap"></img>
                <div class="card-body">
                    <h5 class="card-title">Mesas</h5>
                    <p class="card-text">Distribución de mesas</p>
                </div>
                <ul class="list-group list-group-flush">
                    <li class="list-group-item"><a href="#" class="card-link">Crear mesas</a></li>
                    <li class="list-group-item"><a href="#" class="card-link">Editar mesas</a></li>
                </ul>
            </div>


            <div class="card">
                <img class="card-img-top" src={Reservas} alt="Card image cap"></img>
                <div class="card-body">
                    <h5 class="card-title">Reservas</h5>
                    <p class="card-text">Gestión de reservas</p>
                </div>
                <ul class="list-group list-group-flush">
                    <li class="list-group-item">Cras justo odio</li>
                    <li class="list-group-item">Dapibus ac facilisis in</li>
                    <li class="list-group-item">Vestibulum at eros</li>
                </ul>
                <div class="card-body">
                    <a href="#" class="card-link">Card link</a>
                    <a href="#" class="card-link">Another link</a>
                </div>
            </div>
        </div>
    )
}
